import React from "react";
import { Pagination } from "react-bootstrap";

const ItemsPagination = ({ currentPage, totalPages, onPageChange }) => {
  const handleClick = (pageNum) => {
    onPageChange(pageNum);
  };

  return (
    <Pagination>
      <Pagination.First onClick={() => handleClick(1)} />
      <Pagination.Prev onClick={() => handleClick(currentPage - 1)} />
      {Array.from({ length: totalPages }, (_, index) => (
        <Pagination.Item key={index + 1} active={index + 1 === currentPage} onClick={() => handleClick(index + 1)}>
          {index + 1}
        </Pagination.Item>
      ))}
      <Pagination.Next onClick={() => handleClick(currentPage + 1)} />
      <Pagination.Last onClick={() => handleClick(totalPages)} />
    </Pagination>
  );
};

export default ItemsPagination;
